import React, { Component, useState } from 'react'
import { Table } from 'react-bootstrap'

export class Patients extends Component {
    constructor (props) {
        super(props)
        this.state = {
            columns: [
                'First Name',
                'Last Name',
                'NPI #',
                'Phone Number',
                'Business Address'
            ],
            users: [
                {
                    FirstName: 'John',
                    LastName: 'Doe',
                    NPI: 1245319599,
                    PhoneNumber: '341-294-3432',
                    Address: {
                        Line1: '248 Spruce Street',
                        Line2: '#452',
                        City: 'Baltimoreland',
                        State: 'Maryland',
                        ZipCode: 32194
                    }
                },
                {
                    FirstName: 'Jamie',
                    LastName: 'Friend',
                    NPI: 1245319599,
                    PhoneNumber: '341-294-3432',
                    Address: {
                        Line1: '248 Spruce Street',
                        Line2: '#452',
                        City: 'Baltimoreland',
                        State: 'Maryland',
                        ZipCode: 32194
                    }
                }
            ]
        }

    }

    headers() {
        return this.state.columns.map(col => {
            <th>{ col }</th>
        });
    }

    renderPatient (patient, index) {
        return (
            <tr key={index}>
                <td>{ patient.FirstName }</td>
                <td>{ patient.LastName }</td>
                <td>{ patient.NPI }</td>
                <td> { patient.PhoneNumber }</td>
                <td>Address</td>
            </tr>
        )
    }

    render() {
        return (
        <Table striped bordered hover size='sm'>
            <thead>
                <tr>
                    <th>First Name</th>
                    <th>Last Name</th>
                    <th>NPI #</th>
                    <th>Phone Number</th>
                    <th>Business Address</th>
                </tr>
            </thead>
            <tbody>
                { this.state.users.map(this.renderPatient)}
            </tbody>
        </Table>
        )
  }
}

export default Patients
